import React from 'react';

import mapTag from "../img/mapTag.svg"

function orphanagesMap(){
    return  <div id="page-map">
        <aside>
            <header>
                <img src={mapTag} alt="map"/>
            </header>
        </aside>
    </div>
}

export default orphanagesMap;
